package leetcode;

import java.util.HashMap;
import java.util.Map;

/**
 * 【有效的字母异位词】
 */
public class Solution242 {
    private Map<Character, Integer> getMap(String s) {
        Map<Character, Integer> sMap = new HashMap<>();
        for (Character c: s.toCharArray()) {
            sMap.put(c, sMap.getOrDefault(c, 0) + 1);
        }
        return sMap;
    }

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length())
            return false;

        Map<Character, Integer> sMap = this.getMap(s);
        Map<Character, Integer> tMap = this.getMap(t);

        for (Character key :
                sMap.keySet()) {
            Integer sCount = sMap.getOrDefault(key, 0);
            Integer tCount = tMap.getOrDefault(key, 0);
            if (sCount.intValue() != tCount.intValue())
                return false;
        }

        return true;
    }

    public static void main(String[] args) {
        String s = "";
        String t = "";

        Solution242 sss = new Solution242();
        sss.isAnagram(s, t);
    }
}
